import React from 'react';
import { MDBBtn, MDBContainer } from 'mdb-react-ui-kit';

import Navbar from './components/'

function App() {
  return (
    <MDBContainer fluid>
      <div>
        <Navbar/>
      </div>
    </MDBContainer>
  );
}

export default App;
